import React from 'react';
import Smalls from '../../images/booksandbrewskies/Yourekillingmesmalls.jpg';

const CoolStuff = () => {
  const titleStyle = {
    borderBottom: "2px solid #fff",
    width: "50%",
    margin: "auto",
    padding: "10px"
  }
  return(
    <>
    <div className="cool-stuff pt-5">
      <h1 style={titleStyle}>Meet Your Host</h1>
    <div className="row">
    <div className="col">
      <img src={Smalls} height="200px" width="200px" alt="Smalls"/>
    </div>
    <div className="col">
    </div>
    </div>
    </div>
    </>
  )
}

export default CoolStuff;
